.chatbot-widget-tooltip-content {
  margin-top: 14px;
  font-size: 14px;
  line-height: 18px;
  color: #32536A;
}

.chatbot-widget-tooltip-container>button {
  font-size: 14px;
  line-height: 18px;
  color: #3899EC;
  background: #fff;
  font-weight: var(--wix-font-weight-medium, 530);
  cursor: pointer;
  margin: 6px 0 0 0;
  padding: 0;
  font-family: 'Madefor';
}

.chatbot-widget-header {
  display: flex;
  align-items: center;
  justify-content: flex-end;
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  height: 24px;
  margin: 0 32px;
}

.widget-default-embed .chatbot-widget-header { cursor: move; }

.chatbot-widget-collapse {
  display: block;
  padding: 0;
  border: none;
  outline: none;
  background-color: transparent;
  width: 20px;
  height: 20px;
  cursor: pointer;
}

.chatbot-widget-collapse:after {
  content: ' ';
  display: block;
  padding: 0;
  border: none;
  outline: none;
  width: 14px;
  height: 2px;
  background-color: #fff;
  cursor: pointer;
}

.widget-placeholder-embed .chatbot-widget-collapse { display: none; }

@media only screen and (max-width: 760px) {
  body.chatbot-widget-noscroll {
    overflow: hidden;
  }

  .chatbot-widget-iframe {
    width: 100vw;
    box-shadow: none;
    max-height: none;
    border-radius: 0;
  }

  .chatbot-widget-iframe-container {
    top: 0;
    right: 0;
    padding: 0;
    z-index: 9999;
    height: 100vh;
    background-color: #f0f4f7;
  }
}

@media print {
  .chatbot-widget-tooltip-container,
  .chatbot-widget-button-container,
  .chatbot-widget-iframe-container {
    display: none !important;
  }
}
